import React from "react";
import CaruzelItem from "./CarouselItem";
import caruzelItems from "../carousel.json";
function Craousel() {
  // const list=caruzelItems.map(item=>{

  // });
  return (
    <div id="carouselID" class="carousel slide" data-ride="carousel">
      <div class="carousel-inner">
        <div class="carousel-item active">
          <img class="d-block w-100" src="" />
        </div>
        {caruzelItems.forEach((element) => {
          <CaruzelItem key={element.id} imgUrl={element.imgUrl} />;
        })}
      </div>
      <a
        class="carousel-control-prev"
        href="#carouselID"
        role="button"
        data-slide="prev"
      >
        <span class="carousel-control-prev-icon" aria-hidden="true"></span>
        <span class="sr-only">Previous</span>
      </a>
      <a
        class="carousel-control-next"
        href="#carouselID"
        role="button"
        data-slide="next"
      >
        <span class="carousel-control-next-icon" aria-hidden="true"></span>
        <span class="sr-only">Next</span>
      </a>
    </div>
  );
}
export default Craousel;
